import React from 'react'
import { Nav_bar } from "./../../Composant/jsx/nav_bar";
import  Card  from "./../../Composant/jsx/card";

function Annonce({data}) {
    const datas = data
  return <>
    <div className='box-all-client'>
      <Nav_bar search_bar={true}/>
    </div>
    <div className='box-offer'>
        <div className='listOffer'>
            {datas.map((donnee)=>
                <Card poste={donnee.poste} departement={donnee.departement} description={donnee.description} />
            )} 
        </div>
        <div className='detailOffer'>.</div>
    </div>
  </>
}

export default Annonce
